import React from 'react';

const Hero = () => {
  return (
    <section className="hero">
      <div className="hero-content">
        <h1>St Francis School</h1>
        <p>
          Welcome, Class of 1997! It's time to relive the good old days, reconnect with classmates, 
          and make new memories. Don't miss this once-in-a-lifetime chance to catch up and celebrate together!
        </p>
      </div>
      <div className="hero-image">
        <img src="/images/School_image.webp" alt="Reunion Event" />
      </div>
    </section>
  );
};

export default Hero;
